import './App.css';
import image from './shop.png';
import imageTwo from './man.png';
import {GroceryList} from 'GroceryList'

function App() {
  return (
    <div className='app'>
      <img src={image} width='250px' alt='shop' />
      <h1>Grocery list</h1>
      <img src={imageTwo} width='250px' alt='man' />
<GroceryList />

    </div>
  );
}

export default App;
